svg.script:




var svgDoc;
var headphone;
var MN1;
var MN2;
var MN3;
var backgroud;

var timerFunction = null;

var animRotaz ;


function startup(evt){
  svgDoc=evt.target.ownerDocument;

    headphone = svgDoc.getElementById("headphone"); //get the inner element by id
    MN1 = svgDoc.getElementById("MN1"); 
    MN2 = svgDoc.getElementById("MN2"); 
    MN3 = svgDoc.getElementById("MN3"); 
    no = svgDoc.getElementById("no");
    backgroud = svgDoc.getElementById("backgroud");
    animRotaz = svgDoc.getElementById('canvRotate');
    animRotaz.setAttribute('dur', 0.2+'s');

    off();

    headphone.addEventListener("mouseover",function(){

        on();



    },false); 

    headphone.addEventListener("mouseout",function(){
        stopAnimation();
        off();


    },false); 


    headphone.addEventListener("mouseup",function(){
        stopAnimation();
        disconnect();


    },false); 
};

function on()
{
        startOnAnimation();
        headphone.style.opacity=1;


};

function off()
{


    headphone.style.opacity=0.5;
    MN1.style.visibility="hidden";
    MN2.style.visibility="hidden";
    MN3.style.visibility="hidden";
    no.style.visibility="hidden"; 




    animRotaz.setAttribute('from', '0 200 200');
    animRotaz.setAttribute('to', '0 200 200');


};

function disconnect()
{
    off();
    no.style.visibility="visible";
    startDisconAnimation();

};


function see(n){

  e=svgDoc.getElementById("MN"+n);
  ega=e.style.visibility;
  if (ega=="hidden") e.style.visibility="visible";
  else e.style.visibility="hidden";
};

function shakeHeadphone()
{

    //headphone.transform=translate(400, 400);

};

    function startOnAnimation() {
        if(timerFunction == null) {
            timerFunction = setInterval(onanimate, 200);
        }


    };


    function startDisconAnimation() {
        if(timerFunction == null) {
            timerFunction = setInterval(disconAnimation, 500);
        }


    };

    function stopAnimation() {
        if(timerFunction != null){
            clearInterval(timerFunction);
            timerFunction = null;
        }


    } ; 


var k=1;
var s=1;
function onanimate() {
    if(k>3)
    {
        k=1;
    }
    see(k++);

switch(s++) {
    case 1:
        animRotaz.setAttribute('from', '0 200 200');
        animRotaz.setAttribute('to', '-5 200 200');
        animRotaz.setAttribute('begin', 0+'s');
        break;
    case 2:
        animRotaz.setAttribute('from', '-5 200 200');
        animRotaz.setAttribute('to', '0 200 200');
        animRotaz.setAttribute('begin', 0+'s');
        break;
    case 3:
        animRotaz.setAttribute('from', '0 200 200');
        animRotaz.setAttribute('to', '5 200 200');
        animRotaz.setAttribute('begin', 0+'s');
        break;
    case 4:
        animRotaz.setAttribute('from', '5 200 200');
        animRotaz.setAttribute('to', '0 200 200');
        animRotaz.setAttribute('begin', 0+'s');
        s=1;
        break;
    default:
        s=1;
}






};  

var no_display=true;
function disconAnimation()
{
    if(no_display)
    {
        no.style.visibility="hidden";
        no_display=false;
    }
    else
    {
        no.style.visibility="visible";
        no_display=true;
    }



};
